DROP TABLE IF EXISTS `student_course`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `student_course` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `student_id` int(11) DEFAULT NULL,
  `course_id` int(11) DEFAULT NULL COMMENT '产品包名称',
  `coin_count` int(11) DEFAULT NULL COMMENT '学生购买课程花费的金币',
  `score` tinyint(4) DEFAULT NULL COMMENT '学生对课程的评分',
  `status` tinyint(4) DEFAULT NULL COMMENT '0:已购买，1:待老师确认，3:老师拒绝',
  `comment` varchar(255) DEFAULT NULL,
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `student_id_index` (`student_id`) USING BTREE,
  KEY `course_id_index` (`course_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4100 DEFAULT CHARSET=utf8;
